       width: '100%',
       height: '100%',
       backgroundColor: '#F1F2ED',          
   },
   text:{
    position: 'relative',
    top: '50%',

    left: '10%',
   },

   button:{
    position: 'relative',
    top: '50%',
    margin: 'auto',
    width: '300px',
    height: '50px',
    },
})

